import { Link, NavLink, Outlet } from "react-router-dom";
const Home = () => {
  return (
    <div>
      This is Home
      <h3>test</h3>
      <a href="admin/login">로그인</a>
      <hr />
      <a href="admin/signup">회원가입</a>
    </div>
  );
};

export default Home;
